            </div>
          </NavLink>
        </Fade>

        <Fade delay="900">
          <NavLink
            className="link"
            activeClassName="link-active"
            to="/staff_and_leadership"
          >
            <div className="staff_container">
              <p className="navtext">Leadership</p>
            </div>
          </NavLink>
        </Fade>
        <Fade delay="1050">
          <NavLink
            className="link"
            activeClassName="link-active"
            to="/ministries"
          >
            <div className="ministry_container">
              <p className="navtext">Ministries</p>
